import React from "react";
import { Link } from "react-router-dom";
const Home = () => {
  return (
    <div>
      <Link to="/accounts/login">Log In</Link>
      <br></br>
      <Link to="/accounts/signup">Sign Up</Link>
    </div>
  );
};

export default Home;
